import React, { useState, useEffect } from 'react';
import { useNavigate } from 'react-router-dom';

const UserDashboard = ({ userData }) => {
  const navigate = useNavigate();
  const [recommendations, setRecommendations] = useState(null);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState(null);
  const [errorDetails, setErrorDetails] = useState(null);

  useEffect(() => {
    if (!userData) {
      navigate('/questionnaire');
      return;
    }

    const fetchRecommendations = async () => {
      try {
        setLoading(true);
        setError(null);
        setErrorDetails(null);

        const response = await fetch('http://localhost:3001/api/generateMealPlan', {
          method: 'POST',
          headers: { 'Content-Type': 'application/json' },
          body: JSON.stringify(userData),
        });

        const data = await response.json();

        if (!response.ok || !data.success) {
          throw new Error(data.message || 'Failed to generate meal plan');
        }

        setRecommendations(data.mealPlan);
        setLoading(false);
      } catch (err) {
        setError(`Failed to load your recommendations: ${err.message}`);
        setErrorDetails(err.stack || "No additional details available");
        setLoading(false);
      }
    };

    fetchRecommendations();
  }, [userData, navigate]);

  const handleRetakeQuestionnaire = () => navigate('/questionnaire');
  const handleRefreshRecommendations = async () => {
    setLoading(true);
    try {
      const response = await fetch('http://localhost:3001/api/generateMealPlan', {
        method: 'POST',
        headers: { 'Content-Type': 'application/json' },
        body: JSON.stringify(userData),
      });

      const data = await response.json();
      if (!response.ok || !data.success) {
        throw new Error(data.message || 'Failed to generate meal plan');
      }

      setRecommendations(data.mealPlan);
      setLoading(false);
    } catch (err) {
      setError(`Failed to refresh your recommendations: ${err.message}`);
      setLoading(false);
    }
  };

  if (loading) {
    return (
      <div className="container my-5 text-center">
        <div className="card border-0 rounded-4 shadow-sm">
          <div className="card-body p-5">
            <h2 className="mb-4">Preparing your nutrition plan...</h2>
            <div className="spinner-border" role="status">
              <span className="visually-hidden">Loading...</span>
            </div>
            <p className="mt-4">This may take a few moments as we analyze your health profile.</p>
          </div>
        </div>
      </div>
    );
  }

  if (error) {
    return (
      <div className="container my-5">
        <div className="card border-0 rounded-4 shadow-sm">
          <div className="card-header bg-danger text-white rounded-top-4 p-4">
            <h2>Something went wrong</h2>
          </div>
          <div className="card-body p-4">
            <div className="alert alert-danger">{error}</div>
            {errorDetails && (
              <pre className="p-3 rounded-3 bg-light">{errorDetails}</pre>
            )}
            <div className="d-flex justify-content-center gap-3 mt-4">
              <button className="btn btn-primary" onClick={handleRetakeQuestionnaire}>Retake Questionnaire</button>
              <button className="btn btn-outline-primary" onClick={handleRefreshRecommendations}>Try Again</button>
            </div>
          </div>
        </div>
      </div>
    );
  }

  if (!recommendations) {
    return (
      <div className="container my-5 text-center">
        <div className="card border-0 rounded-4 shadow-sm">
          <div className="card-body p-5">
            <h2>No recommendations available</h2>
            <p className="text-muted">Please complete the health questionnaire to receive personalized recommendations.</p>
            <button className="btn btn-primary" onClick={handleRetakeQuestionnaire}>Take Questionnaire</button>
          </div>
        </div>
      </div>
    );
  }

  return (
    <div className="container-fluid py-4">
      <div className="container">
        <div className="row mb-4">
          <div className="col-12">
            <div className="card border-0 rounded-4 shadow-sm">
              <div className="card-body p-4">
                <div className="d-flex justify-content-between align-items-center">
                  <h1>Your Nutrition Plan</h1>
                  <div className="d-flex gap-2">
                    <button className="btn btn-outline-secondary" onClick={handleRetakeQuestionnaire}>Update Profile</button>
                    <button className="btn btn-primary" onClick={handleRefreshRecommendations}>Refresh Plan</button>
                  </div>
                </div>
              </div>
            </div>
          </div>
        </div>
      </div>
    </div>
  );
};

export default UserDashboard;
